import React from "react";

export const ContactForm = ({
  name,
  setName,
  phone,
  setPhone,
  email,
  setEmail,
  handleSubmit
}) => {
  return (
    <>
    <form onSubmit={handleSubmit}>
      <input type="text" onChange={setName} value={name}/>
      <input type="text" onChange={setPhone} value={phone}/>
      <input type="text" onChange={setEmail} value={email}/>
    </form>
    </>
  );
};
